create table thing_history
(
    thing_history_id bigint auto_increment
        primary key,
    change_thing     bigint       not null,
    thing_content    varchar(255) not null,
    thing_day        datetime(6)  null,
    user_id          bigint       not null,
    constraint FKl4kr7xjyo4mxo5mth8saqfc8c
        foreign key (user_id) references users (user_id)
);

create index idx_thinghistory_user_id
    on thing_history (user_id);

